void screen256_pack() {
    short *sp;
    outp(0x6a, 0x07);
    outp(0x6a, 0x21);
    outp(0xa4, 0x00);
    outp(0xa6, 0x00);
    outp(0x09a8, 0x00);
    sp = (short *)0xe0100;
    *sp = 0;
    sp = (short *)0xe0102;
    *sp = 0;
}

void fill0(char a) {
    char *p01;
    short *sp;
    int  i, j;
    for (j = 0; j < 16; j++) {
        sp = (short *)0xe0004;
        *sp = (short)j;
        p01 = (char *)VRAM0;
        for (i = 0; i < 0x8000; i++) {
            *p01++ = a;
        }
    }
}

void fill1(char a) {
    char *p01;
    short *sp;
    int  i, j;
    for (j = 0; j < 16; j++) {
        sp = (short *)0xe0006;
        *sp = (short)j;
        p01 = (char *)VRAM1;
        for (i = 0; i < 0x8000; i++) {
            *p01++ = a;
        }
    }
}

void pset(int x, int y, int color) {
    int      n, offset0;
    short    bank0;
    short    *sp;
    char     *cp;

    n = y * 640 + x;
    bank0 = (short)(n >> 15);
    sp = (short *)0xe0004;
    *sp = bank0;
    offset0 = n & 0x7fff;
    cp = (char *)(VRAM0 + offset0);
    *cp = color;
}

void set_palette(int num, int colr, int colg, int colb) {
    outp(0xa8, num);
    outp(0xaa, colg);
    outp(0xac, colr);
    outp(0xae, colb);
}

void put_bmp8(char *data, unsigned int *palette) {
    char *p01, *p02;
    short *sp;
    int  i, j;
    char colr, colg, colb;

    for (i = 0; i < 256; i++) {
        colr = *palette >> 16;
        colg = (*palette >> 8) & 0xff;
        colb = *palette & 0xff;
	set_palette(i, colr, colg, colb);
	palette++;
    }

    p02 = data;
    for (j = 0; j < 16; j++) {
        sp = (short *)0xe0004;
        *sp = (short)j;
        p01 = (char *)VRAM0;
        for (i = 0; i < 0x8000; i++) {
	    *p01++ = *p02++;
        }
    }
}

